import './Muungano.css';
import ReturnTitle from './Title';
import ReturnSuBTitle from './SubTitle';

// Moogano Money
export default function ReturnMuungAnO() {
 return (
  <div className='wrp-muungano-actif'>
   <ReturnTitle Text={'MuunganoMoney'} />

   <div className='muungano-sub-title'>
    <ReturnSuBTitle Text={'E-Money'} cdf={`CDF`} usd={`USD`} />
    <ReturnSuBTitle Text={'Commission'} cdf={`CDF`} usd={`USD`} />

   </div>
  </div>
 );
};
